function PokeList({ pokemon }) {
    return (
        <div className="container">
            {pokemon.map(p => (
                <div>
                    <div className="poke-div" key={p.name}>{p.name} <img src= {p.sprites.front_default}/></div>

                </div>
            ))}
        </div>
    )

}

